package programday1;

public class Power {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
int i=1,n=2;
		System.out.println(i*i);
		i++;
		System.out.println(i*n);
		i++;
		n++;
		System.out.println(i*i*n);
		i++;
		n++;
		System.out.println(i*i*i*n);
	}

}
